import React from 'react';

function About() {
  return (
    <div className="about">
      <h2 className="text-3xl font-bold mb-4">Tentang Kami</h2>
      <p className="text-lg">Informasi lebih lanjut tentang PaDi UMKM.</p>
    </div>
  );
}

export default About;
